import { Col, Container, Row } from "reactstrap";
import Example from "./Components/Example";

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col className="text-center">
            <Example/>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
